  inline void transform_inits_impl(VecVar& params_r__, VecI& params_i__,
                                   VecVar& vars__,
                                   std::ostream* pstream__ = nullptr) const {
    using local_scalar_t__ = double;
    stan::io::deserializer<local_scalar_t__> in__(params_r__, params_i__);
    stan::io::serializer<local_scalar_t__> out__(vars__);
    int current_statement__ = 0;
    local_scalar_t__ DUMMY_VAR__(std::numeric_limits<double>::quiet_NaN());
    
    try {
      int pos__;
      pos__ = std::numeric_limits<int>::min();
      
      pos__ = 1;
      local_scalar_t__ k_a;
      k_a = DUMMY_VAR__;
      
      k_a = in__.read<local_scalar_t__>();
      out__.write_free_lb(0, k_a);
      local_scalar_t__ K_m;
      K_m = DUMMY_VAR__;
      
      K_m = in__.read<local_scalar_t__>();
      out__.write_free_lb(0, K_m);
      local_scalar_t__ V_m;
      V_m = DUMMY_VAR__;
      
      V_m = in__.read<local_scalar_t__>();
      out__.write_free_lb(0, V_m);
      local_scalar_t__ sigma;
      sigma = DUMMY_VAR__;
      
      sigma = in__.read<local_scalar_t__>();
      out__.write_free_lb(0, sigma);
    } catch (const std::exception& e) {
      stan::lang::rethrow_located(e, locations_array__[current_statement__]);
    }
    } // transform_inits_impl() 
    
